    NUMPOINTS: 4
    TIMES: [0, 0.02, 1, 5e+06]
    VALUES: [0, 1, 1, 1]
FUNCT3:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.5"
FUNCT4:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.5*(1+cos(pi/5*x))"
FUNCT5:
