    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.5*(1+cos(pi/5*x))"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 2
